import React, {Component} from "react"
import Title from "./Title";
import Icono from "../Icono.png";
import Eth from "../eth.png";
import Meta from "../metamask.png"

export default class Home extends Component{
  render() {
    return(
      <div className="container">
        <Title name="Welcome to" title="CryptoStockZ"/>
        <div className="row">
          <img style={{width: '200px', height: '200px'}} src={Icono} alt="Icono_CSZ" className="navbar-brand"/>
          <img style={{width: '130px', height: '200px'}} src={Eth} alt="Icono_Eth" className="navbar-brand"/>
          <img style={{width: '200px', height: '200px'}} src={Meta} alt="store" className="navbar-brand"/>
        </div>
      </div>
    )
  }
}
